var map;
var code = "RWM709475+";
var pdm = new GGeoXml("http://lifesciencedb.jp/ag/examples/misc/nci/cl-12-04-05-419700544.kmz");    
var imagedir = "images/nci/";  
var miscdir = "misc/nci/";  

	function onLoad() {
		if(GBrowserIsCompatible()){
			makeHeatMap(code);
		}
	}

	function cbClicked(){
		var toggle = document.getElementById("cb");
		if(toggle.checked){
			addPopulationDensity();
		}else{
			removePopulationDensity();
		}
	}
		
	function removePopulationDensity(){
		map.removeOverlay(pdm);
	}

	function addPopulationDensity(){
    map.addOverlay(pdm);
	}

	function makeHeatMap(code){
		var mapid = code.replace(/\+$/, "");	

		map = new GMap2(document.getElementById(mapid));
	  map.setCenter(new GLatLng(40, -95),4);
	  map.addControl(new GLargeMapControl());
	  map.addControl(new GMapTypeControl());
	  map.addControl(new GOverviewMapControl());
//	 	map.setMapType(G_SATELLITE_TYPE);
//	  map.setMapType(G_HYBRID_TYPE);
	  map.enableDoubleClickZoom();	  

		addPopulationDensity();				

		function makeColorBar(){
			var imageUrl = imagedir + "/opaque/RWM709475+/cb.png";
      var screenXY = new GScreenPoint(200, 20);
      var overlayXY = new GScreenPoint(0, 0);
      var sz = new GScreenSize(350, 50);

      var overlay = new GScreenOverlay(imageUrl, screenXY, overlayXY, sz);

      map.addOverlay(overlay);
		}
		
		makeColorBar();
				
	  function makeMarker(capital, code, size){
			var icon = new GIcon();
			icon.image = imagedir + "/trans/" + code + "/" + capital + ".png";

			if(size == "small"){		
				icon.iconSize = new GSize(40, 120);
				icon.iconAnchor =  new GPoint(20, 120);
    		icon.infoWindowAnchor = new GPoint(25, 10);		
			}else if(size == "medium"){		
				icon.iconSize = new GSize(80, 240);
				icon.iconAnchor =  new GPoint(40, 240);
    		icon.infoWindowAnchor = new GPoint(50, 20);
			}else if(size == "large"){		
				icon.iconSize = new GSize(120, 360);
				icon.iconAnchor =  new GPoint(60, 360);		
    		icon.infoWindowAnchor = new GPoint(70, 30);
			}else{
				icon.iconSize = new GSize(200, 600);
				icon.iconAnchor =  new GPoint(80, 480);		
    		icon.infoWindowAnchor = new GPoint(120, 40);
			}

			var latlng = new GLatLng(lats[capital], lngs[capital]);			
			var marker = new GMarker(latlng, icon);

			var url = link[capital];
			var html = "State name: " + toLong[capital] + "<br/>"
				+ "<a href=" + url +  " target='_blank'>Click to Anatomography Editor</a><br />"
				+ "<img src='" + imagedir + "/movie/" + code + "/" + capital + ".gif' />";
    	GEvent.addListener(marker, "click", function() {
     		marker.openInfoWindowHtml(html);
    	});

    	return marker;
		}
	
		var mgr = new GMarkerManager(map);
					
		for (var capital in lats) {	
			mgr.addMarker(makeMarker(capital, code, "small"), 0,4);			
			mgr.addMarker(makeMarker(capital, code, "medium"), 5,6);
			mgr.addMarker(makeMarker(capital, code, "large"), 7,9);
			mgr.addMarker(makeMarker(capital, code, "huge"), 10);
		}
		mgr.refresh();
	}
	       
